@lavahouston … I visited this place and it fulfilled all my expectations  starting with a delicious Mediterranean meal with a mix of exquisite flavors that I never tried before , let’s talk about the drinks damn pretty refreshing and delicious , and my last favorite part was that dessert 🍮Besides  this place has a luxury clean and nice spaces indoor and outdoor that you can go over and chill with your friends.

 📍9705 Westheimer Rd
Houston, TX  77042
